import { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../css/LogIn.css";
import * as Joi from 'joi';


function Register(props) {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const [email, setEmail] = useState("");
    const [phone, setPhone] = useState("");
    const navigate = useNavigate();




    const emailSchema = Joi.string().email({ minDomainSegments: 2 }).required();
    const phoneSchema = Joi.string().regex(/^[0-9]{10}$/).required();
    const usernameSchema = Joi.string().alphanum().min(3).max(30).required();
    const passwordSchema = Joi.string().pattern(new RegExp('^(?=.[A-Z])(?=.[0-9])(?=.[!@#$%^&])[a-zA-Z0-9!@#$%^&*]{8,30}$')).required();

    const emailValidation = Joi.validate(email, emailSchema);
    if (emailValidation.error) {
        console.log(emailValidation.error.message);
    } else {
        console.log("valid email")
        const phoneValidation = Joi.validate(phone, phoneSchema);
        if (phoneValidation.error) {
            console.log(phoneValidation.error.message);
        } else {
            console.log("valid phone number")
            const usernameValidation = Joi.validate(username, usernameSchema);
            if (usernameValidation.error) {
                console.log(usernameValidation.error.message);
            } else {
                console.log("valid username")
                const passwordValidation = Joi.validate(password, passwordSchema);
                if (passwordValidation.error) {
                    console.log(passwordValidation.error.message);
                } else {
                    console.log("valid password")
                }
            }
        }
    }


    const handleSubmit = async (e) => {
        e.preventDefault();
        const response = await fetch(`http://localhost:8080/users`, {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify({
                username: username,
                password: password,
                phone: phone,
                email: email
            })
        });
        const data = await response.json();
        if (data) {
            props.setFlag(false);
        }
    };
    return (
        <div className="login-root">
            <div className="box-root padding-top--24 flex-flex flex-direction--column" style={{ flexGrow: 1, zIndex: 9 }}>
                <div className="formbg-outer">
                    <div className="formbg">
                        <button id="exit" onClick={() => props.setFlag(false)}>X</button>
                        <div className="formbg-inner padding-horizontal--48">
                            <span className="padding-bottom--15">Create your account</span>
                            <form id="stripe-login">
                                <div className="field padding-bottom--24">
                                    <label htmlFor="username">User-Name</label>
                                    <input type="text" name="username" value={username}
                                        onChange={(e) => {
                                            setUsername(e.target.value);
                                            console.log(username);
                                        }} />
                                </div>
                                <div className="field padding-bottom--24">
                                    <div className="grid--50-50">
                                        <label htmlFor="password">Password</label>
                                    </div>
                                    <input type="password" name="password" value={password}
                                        onChange={(e) => {
                                            setPassword(e.target.value);
                                            console.log(password);
                                        }} />
                                </div>
                                <div className="field padding-bottom--24">
                                    <label htmlFor="email">Email</label>
                                    <input type="email" name="email" value={email}
                                        onChange={(e) => {
                                            setEmail(e.target.value);
                                            console.log(email);
                                        }} />
                                </div>
                                <div className="field padding-bottom--24">
                                    <label htmlFor="phone">Phone number</label>
                                    <input type="text" name="phone" value={phone}
                                        onChange={(e) => {
                                            setPhone(e.target.value);
                                            console.log(phone);
                                        }} />
                                </div>
                                <div className="field padding-bottom--24">
                                    <button onClick={handleSubmit}>Register</button>
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Register;
